import React from "react";

const Card =()=>{
    return(
        <div>
            <img alt="onions" scr="/Vegestables/onions.png"></img>
            <h2>onios</h2>
            <h3>tipo 1</h3>
            <h4>febrero</h4>
    </div>
    );
}

export default Card;
